import React from 'react';
import {Component} from 'react';
import Header from './Header.jsx';
import './App.css';
import Homepage from './Homepage.jsx';
import Navi from './nav.jsx';
import Locations from './Locations.jsx';
import Locationdata from './Locationdata.jsx';
import './w3.css'




class App extends Component {
  constructor()
  {
    super();
    this.state=
    {
      id:''
    }
  }


  Handle = (f) => 
  { 
    this.setState({id:f});
  }

  mainhandle =(f) =>
  {
    if(f==1)
    {
      <Homepage/>
    }
    else if(f==2)
    {
      <Locations ids={this.Handle}/>
    }
    else if(f==3)
    {
      <Locationdata/>
    }
  }

  render()
{
  return (
    <div className="App">

     <Header heading="heading"/>
     <Navi id={this.state.id}/>
     <div id="maindata" onLoad={this.mainhandle(2)}>

     </div>







    </div>
  );
}
}

export default App;
